import React from 'react';
import './TableList.css';

class TableList extends React.Component {

   render() {
      const listItems = this.props.datatList.map(
         (item) =>
            <tr key={item._id}>
               <td>{item.patient.name}</td>
               <td>{item.hospital}</td>
               <td>{item.date_from}</td>
               <td>{item.date_to}</td>
               <td>{item.isApproved ? 'Approves' : 'Pending'}</td>
            </tr>
      );

      return (
         <div>
            <h2>Table List</h2>
            <table>
               <tbody>
                  <tr>
                     <th>Name</th>
                     <th>Hospital</th>
                     <th>Date From</th>
                     <th>Date To</th>
                     <th>Status</th>
                  </tr>
                  {listItems}
               </tbody>
            </table>
            {this.props.location.state.loginInfoObj[0].role}
         </div>
      )
   }
}

export default TableList;
